import React from 'react'
import {Link} from 'react-router-dom';

function Navbar(){
return(
        <div className = 'navbar'>
            <div className='navbar-logo'>
                Nutripro
            </div>
        <ul className='navbar-menu'> 
            <li><Link to = "/Login">Login</Link></li>
        </ul>
        </div>


)

}
export default Navbar
